import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from "react-router-dom";
import Posts from './components/Posts';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Posts />
    </BrowserRouter>,
  </React.StrictMode>,
  document.getElementById('root')
);
